import React from 'react';

class ProductCard extends React.Component {
  render() {
    const { products } = this.props;
    return (
      <div>
        { products
          .map(product => 
            <div data-testid="product">
              <p>{ product.title }</p>
              <img src={product.thumbnail} />
              <p>{ product.price }</p>
            </div>)}
      </div>
    );
  }
}

export default ProductCard;
